import React from 'react';
import { Modal } from 'antd';

const DecisionModal = ({ decision, visible, onClose }) => {
  if (!decision) return null;

  return (
    <Modal open={visible} onCancel={onClose} footer={null} width={700}>
      <h3>Decision: {decision.decision}</h3>
      <p><strong>Reason:</strong> {decision.reason}</p>
      <p><strong>Triggered by:</strong> {decision.trigger_message}</p>
      {decision.linked_outcomes?.length > 0 && (
        <>
          <strong>Linked Outcomes:</strong>
          <ul>
            {decision.linked_outcomes.map((o, idx) => (
              <li key={idx}>{o}</li>
            ))}
          </ul>
        </>
      )}
    </Modal>
  );
};

export default DecisionModal;
